import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <h1>
        <a href='index.html'> MERN AUTH</a>
      </h1>
      <ul>
        <li>
          <Link to='/register'>Register</Link>
        </li>
        <li>
          <a href='login.html'>Login</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
